import React,{useState, useEffect} from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import About from './pages/About';
import './styles/App.css';

function App() {
	return(
		<BrowserRouter >
		<Routes>
			<Route path="/about">
				<About/>
			</Route>
		</Routes>

		</BrowserRouter>
	)
}
export default App;
